import React from "react";

const chats = () => {
  return (
    <div>
      <div className="userchat">
        <img
          src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS3lAsaRkY1bio7NHqRCtay8n-WZSMXHGBpcA&usqp=CAU"
          alt=""
        />
        <span>Amal</span>
      </div>
    </div>
  );
};

export default chats;
